import React from 'react';
import Carticon from './img/carticon.png';


import Cartstyle from './cart-dropdown.styles.css';

const CartDropdown = () => (
 <div className='cart-dropdown'>
 <div className='cart-item' >
  <img src={Carticon} className="cart-item-img"/>
  <div className="cart-item-details">
      <p className="cart-item-title margin0">Adidas </p>
       <p className="cart-item-before-price margin0">   EGP </p>
       <p className="cart-item-price margin0">   EGP  </p>
       <div className="cart-item-bar margin0">
           <p className="margin" >remove</p>
         </div>
   </div>
  
    
 </div>
    <button>Go To Checkout</button>
</div>
);

export default CartDropdown;
